uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User parameters
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_grid_density;
uniform float u_wire_width;
uniform float u_red_intensity;

out vec4 fragColor;

// 2D Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Simple hash for noise
float hash(vec2 p) {
    return fract(sin(dot(p, vec2(127.1, 311.7))) * 43758.5453123);
}

// Fractal Brownian Motion for Martian Terrain
float noise(vec2 p) {
    vec2 i = floor(p);
    vec2 f = fract(p);
    vec2 u = f * f * (3.0 - 2.0 * f);
    return mix(mix(hash(i + vec3(0,0,0).xy), hash(i + vec3(1,0,0).xy), u.x),
               mix(hash(i + vec3(0,1,0).xy), hash(i + vec3(1,1,0).xy), u.x), u.y);
}

float fbm(vec2 p) {
    float v = 0.0;
    float a = 0.5;
    mat2 m = rot(0.37);
    for (int i = 0; i < 5; i++) {
        v += a * noise(p);
        p = m * p * 2.02;
        a *= 0.5;
    }
    return v;
}

// Distance Function for the Terrain
float map(vec3 p) {
    float h = fbm(p.xz * 0.4) * 2.5;
    h += fbm(p.xz * 1.5) * 0.3; // Added detail
    return p.y + h;
}

// Calculate normal for lighting
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

// Grid/Wireframe function
float wireframe(vec3 p, vec3 n) {
    vec2 uv = p.xz * u_grid_density;
    vec2 grid = abs(fract(uv - 0.5) - 0.5) / (u_wire_width * u_grid_density);
    float line = min(grid.x, grid.y);
    return 1.0 - smoothstep(0.0, 1.0, line);
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // 1. Path & Camera Movement
    float t = iTime * u_speed;
    vec3 pathPos = vec3(0.0, 0.0, t);

    // Rail system: Look ahead but maintain offset height
    vec3 ro = pathPos + vec3(sin(t * 0.2) * 0.5, u_camera_dist, 0.0);
    vec3 ta = pathPos + vec3(sin((t + 5.0) * 0.2) * 0.5, u_camera_dist * 0.8, 5.0);

    // Camera matrix
    vec3 cw = normalize(ta - ro);
    vec3 cu = normalize(cross(cw, vec3(0.0, 1.0, 0.0)));
    vec3 cv = normalize(cross(cu, cw));
    vec3 rd = normalize(uv.x * cu + uv.y * cv + 1.5 * cw);

    // 2. Raymarching
    float d = 0.0;
    float t_dist = 0.01;
    vec3 p;
    for(int i = 0; i < 100; i++) {
        p = ro + rd * t_dist;
        d = map(p);
        if(d < 0.001 || t_dist > 40.0) break;
        t_dist += d * 0.6; // Relaxed step for terrain
    }

    // 3. Shading
    vec3 col = vec3(0.0);

    // Atmospheric "Matter" / Stars
    float stars = pow(hash(uv + floor(iTime * 10.0) * 0.01), 50.0);
    vec3 spaceMatter = vec3(1.0, 0.4, 0.2) * stars * step(0.999, hash(uv * 100.0));

    if(t_dist < 40.0) {
        vec3 n = getNormal(p);
        float wire = wireframe(p, n);

        // Base Martian Color
        vec3 marsRed = vec3(0.8, 0.2, 0.05) * u_red_intensity;
        vec3 techColor = vec3(1.0, 0.6, 0.1); // Bright orange/gold for wires

        // Lighting
        float diff = max(dot(n, normalize(vec3(1, 2, -1))), 0.0);
        float fres = pow(1.0 + dot(rd, n), 4.0);

        // Mix terrain and wireframe
        col = mix(marsRed * diff * 0.2, techColor, wire);
        col += fres * techColor * 0.5; // Rim glow on wires

        // Distance Fog
        col = mix(col, vec3(0.05, 0.01, 0.0), smoothstep(10.0, 40.0, t_dist));
    } else {
        // Space Background
        col = spaceMatter;
        // Horizon Glow
        float horizon = smoothstep(0.2, -0.4, rd.y);
        col += vec3(0.6, 0.1, 0.0) * horizon * 0.5;
    }

    // Scanning line effect
    float scanline = sin(uv.y * 200.0 + iTime * 5.0) * 0.02;
    col += scanline;

    // Output with subtle vignette
    float vignette = 1.0 - length(uv * 0.8);
    fragColor = vec4(col * vignette, 1.0);
}
